        super()
        this.state = {
            email: "",
            password: ""
        }
    }

    render() {
        const {email, password} = this.state;
        return (
        <div>
            <input type="email" value={email} onChange={e => this.setState({email: e.target.value})}/>
            <input type="password" value={password} onChange={e => this.setState({password: e.target.value})}/>
